import {Link} from 'react-router-dom'

const Nav = () => {
  return (
    <nav className='navbar navbar-expanded-lg navbar-light bg-light'>
      <ul className='navbar-nav me-auto mb-2 mb-lg-0'>
        <li className='nav-item'>love</li>
        <li>french</li>
        <li>english</li>
      </ul>
    </nav>
  )
}

export default Nav
